        <div className="Side-bar-icon">
          <Link to="/damage-defect-form">
            <img src={FormIcon} style={sideBarIconStyle} alt="forms"></img>
          </Link>
        </div>
      </Col> */}
      <MDBNav>
        <MDBNavItem>
